    false,nt"url": null,nt"notes": "This data set is a complete digital hydrologic
    unit boundary layer to the Subwatershed (12-digit) 6th level for the State of New
    Mexico. This data set consists of geo-referenced digital data and associated attributes
    created in accordance with the "FGDC Proposal, Version 1.0 - Federal Standards
    For Delineation of Hydrologic Unit Boundaries 3/01/02"(http://www.ftw.nrcs.usda.gov/huc_data.html).
    Polygons are attributed with hydrologic unit codes for 4th level sub-basins, 5th
    level watersheds, 6th level subwatersheds, name, size, downstream hydrologic unit,
    type of watershed, non-contributing areas and flow modification. Arcs are attributed
    with the highest hydrologic unit code for each watershed, linesource and a metadata
    reference file.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
